import logo from './logo.svg';
import './App.css';
import { MdCurrencyExchange } from "react-icons/md";


function App() {
  return (
    <div className="App">
      <div><MdCurrencyExchange className="logo"/></div>
      <div className="data">
        <h2>BMI Calculator</h2>
      </div>
    </div>
  );
}

export default App;
